void LexParser::handleSematicAction(int rnum)
{
	int stackstartpos=sstack.top()-Rules[rnum].blen;
	switch(rnum)
	{
	case 1:
		printf("accept!!");
		break;
	case 2:
		printf("accept!!");
		break;
	case 4:
		{ofstream outf("_lblock1",ios::app);scanner.writeLitBlock(outf);outf.close();}
		break;
	case 12:
		{ofstream outf("_lblock2",ios::app);scanner.writeLitBlock(outf);outf.close();}
		break;
	case 8:
		lex.addMacroDefinition(sstack.getAt(stackstartpos+1).val.str,sstack.getAt(stackstartpos+2).val.str);
		break;
	case 11:
		lex.addStartState(sstack.getAt(stackstartpos+2).val.str);
		break;
	case 9:
		strcpy(curval.str,sstack.getAt(stackstartpos+1).val.str);
		break;
	case 10:
		strcpy(curval.str,sstack.getAt(stackstartpos+1).val.str);
		break;
	case 18:
		defExprs.add(sstack.getAt(stackstartpos+1).val.str);
		break;
	case 17:
		defExprs.add(sstack.getAt(stackstartpos+3).val.str);
		break;
	case 16:
		for(int i=0;i<defExprs.exprcnt;i++)	lex.addTokenDef(defExprs.exprs[i],sstack.getAt(stackstartpos+2).val.str);
		defExprs.exprcnt=0;
		break;
	default:
		curval.ival=sstack.getAt(stackstartpos+1).val.ival;
		break;
	}
}
void LexParser::parseerror(char* str)
{
	printf("lr parse error: %s\n",str);
}


