bool LexParser::yyparse(char* symbols)
{
	int s,a;

	sstack.init();
	scanner.scanNewCode(symbols);

	a=scanner.yylex();
	if(a==0) return true;
	else if(a==-1) return false;

	while(true)
	{
		s=sstack.peek().state;

		switch(parseAction[s][a].action)
		{
		case 's':
			sstack.push(StackEntry(parseAction[s][a].param,yylval));
			a=scanner.yylex();
			if(a==0) a=TERMEOF;
			else if(a==-1)
			{
				printf("lr parse error: error from yylex, stop parsing.\n");
				return false;
			}
			break;
		case 'r':
			{
				curval=yylval;
				handleSematicAction(parseAction[s][a].param);

				int *p=Rules[parseAction[s][a].param].body;
				while(*p)
				{					
					if(*p!=TERMEMPTY) sstack.pop();
					p++;
				}
				/*-NONTERM_BASE*/
				sstack.push(StackEntry(parseGoto[sstack.peek().state][Rules[parseAction[s][a].param].lhs],curval));	
			}
			break;
		case 'a':
			return true;
		default:
			parseerror("unknown error, stop parsing.");
			return false;
		}			
	}
}


Stack::Stack()
{
	init();
}

Stack::~Stack()
{
}

bool Stack::isEmpty()
{
	return _top==-1;
}

bool Stack::isFull()
{
	return _top>=PARSESTACK_SIZE-1;
}

const StackEntry& Stack::peek()
{
	if(!isEmpty())
		return element[_top];
}

void Stack::pop()
{
	if(!isEmpty())
		--_top;
}

StackEntry& Stack::getAt(int n)
{
	if(n>=0&&n<=_top)
		return element[n];
}

int Stack::top()
{
	return _top;
}

void Stack::init()
{
	element[0]=StackEntry(0);
	_top=0;
}

bool Stack::push(const StackEntry& x)
{
	if(isFull()) return false;

	_top++;	
	element[_top]=x;
	return true;
}

